We have 3 different types of nodes: root: This is the root node of the graph. It is a built-in node type and each graph has one root node only. faq_root: This is the entry point of the FAQ handler. We will make the decision on the most relevant answer at this node. faq_state: This node represents a FAQ entry. It contains a candidate answer from the knowledge base. Now let's define the custom node types. node faq_root;
node faq_state { has question; has answer;
} The has keyword defines a node's variables. In this case, each faq_state has a question and answer. Warning The root node does not need explicit definition. It is a built-in node type. Avoid using root as a custom node type.

254.body:
For this FAQ chatbot, we will build a graph as illustrated here: Architecture of FAQ Bot The idea here is that we will decide which FAQ entry is the most relevant to the incoming question at the faq_root node and then we will traverse to that node to fetch the corresponding answer. To define this graph architecture: // Static graph definition
graph faq { has anchor faq_root; spawn { // Spawning the nodes faq_root = spawn node::faq_root; faq_answer_1 = spawn node::faq_state( question="How do I configure my order?", answer="To configure your order, log into your Tesla account." ); faq_answer_2 = spawn node::faq_state( question="How do I order a tesla", answer="Visit our design studio to place your order." ); faq_answer_3 = spawn node::faq_state( question="Can I request a test drive", answer="Yes. You must be a minimum of 25 years of age." ); // Connecting the nodes together faq_root --> faq_answer_1; faq_root --> faq_answer_2; faq_root --> faq_answer_3; }
} Let's break down this piece of code. We observe two uses of the spawn keyword. To spawn a node of a specific type, use the spawn keyword for: faq_answer_1 = spawn node::faq_state( question="How do I configure my order?", answer="To configure your order, log into your Tesla account.",
); In the above example, we just spawned a faq_state node called faq_answer_1 and initialized its question and answer variables. Note The spawn keyword can be used in this style to spawn many different jaseci objects, such as nodes, graphs and walkers. The second usage of spawn is with the graph: graph faq { has anchor faq_root; spawn { ... }
} In this context, the spawn designates a code block with programmatic functionality to spawn a subgraph for which the root node of that spawned graph will be the has anchor faq_root. In this block: We spawn 4 nodes, one of the type faq_root and three of the type faq_state. We connect each of the faq answer states to the faq root with faq_root --> faq_answer_*. We set the faq_root as the anchor node of the graph. As we will later see, spawning a graph will return its anchor node. Warning An anchor node is required for every graph block. It must be assigned inside the spawn block of the graph definition.

257.body:
Alright, we have initialized the graph. Now it's time to create the code for the question-answering. We will start with a simple string matching for the answer selection algorithm. For this, we will create a new walker called ask. walker ask { has question; root { question = std.input("AMA > "); take --> node::faq_root; } faq_root { take --> node::faq_state(question==question); } faq_state {: std.out(here.answer); }
} This walker is more complex than the init one and introduces a few new concepts so let's break it down! Similar to nodes, walkers can also contain has variables. They define variables of the walker. They can also be passed as parameters when calling the walker. std.input and std.out read and write to the command line respectively. This walker has logic for three types of node: root, faq_root and faq_state. root: It simply traverses to the faq_root node. faq_root: This is where the answer selection algorithm is. We will find the most relevant faq_state and then traverse to that node via a take statement. In this code snippet, we are using a very simple (and limited) string matching approach to try to match the predefined FAQ question with the user question. faq_state: Print the answer to the terminal. Before we run this walker, we are going to update the init walker to speed up our development process walker init { root { spawn here --> graph::faq; spawn here walker::ask; }
} This serves as a shorthand so that we can initialize the graph and ask a question in one command. Note This demonstrates how one walker can spawn another walker using the spawn keyword. Time to run the walker! jaseci > jac run main.jac jac run functions very similarly to jac dot, with the only difference being that it doesn't return the graph in DOT format. Try giving it one of the three questions we have predefined and it should respond with the corresponding answer.

259.body:
So far we have created a FAQ bot that is capable of providing answer in three topics. To make this useful beyond just a prototype, we are now going to expand its database of answers. Instead of manually spawning and connecting a node for each FAQ entry, we are going to write a walker that automatically expands our graph: walker ingest_faq { has kb_file; root: take --> node::faq_root; faq_root { kb = file.load_json(kb_file); for faq in kb { answer = faq["answer"]; spawn here --> node::faq_state(answer=answer); } }
} An example knowledge base file look like this [ { "question": "I have a Model 3 reservation, how do I configure my order?", "answer": "To configure your order, log into your Tesla Account and select manage on your existing reservation to configure your Tesla. Your original USD deposit has now been converted to SGD." }, { "question": "How do I order a Tesla?", "answer": "Visit our Design Studio to explore our latest options and place your order. The purchase price and estimated delivery date will change based on your configuration." }, { "question": "Can I request a Test Drive?", "answer": "Yes, you can request for a test drive. Please note that drivers must be a minimum of 25 years of age and not exceeding 65 years of age, hold a full driving license with over 2 years of driving experience. Insurance conditions relating to your specific status must be reviewed and accepted prior to the test drive." }
] Save the above json in a file named tesla_faq.json and make sure it is in the same location as main.jac. Let's now update the init walker. Because we are going to use the ingest_faq walker to generate the graph, we won't need the static graph definition. walker init { root { spawn here --> node::faq_root; spawn here walker::ingest_faq(kb_file="tesla_faq.json"); spawn here walker::ask; }
} What we are doing here is Spawning a faq_root node Running the ingest_faq walker to create the neccessary faq_state nodes based on the question-answer entries in the tesla_faq.json file. Launching the ask walker Let's run the program one more time and test it out! jaseci > jac run main.jac Note Try more varied questions. Now we have a longer answer with more rich information, it has a higher coverage of information that will be able to answer more questions. Note If you are feeling adventurous, try downloading the complete list of entires on the Tesla FAQ page and use it to create a production-level FAQ bot. See if you can push the model to its limit!

