} Similar to the first walker we built for the FAQ system, we are starting with a simple string matching algorithm. Let's update the init walker to include this walker. walker init { root { spawn here --> graph::dialogue_system; spawn here walker::talk; }
} Try out the following interactions $ jsctl jac run dialogue.jac
> test drive
