} What is happening here is based on the user's question, we are traversing the corresponding dialogue state and then return the response of that state. For now, we are just matching the incoming question with the intent label as a simple algorithm, which we will now replace with an AI model. Note Notice we are running jsctl commands directly from the terminal without first entering the jaseci shell? Any jsctl commands can be launched directly from the terminal by just prepending it with jsctl. Try it with the other jsctl comamnds we have encountered so far, such as jac dot.

