Now let's update our walker to use the trained intent classifier. walker talk { has question; can bi_enc.infer; root { question = std.input("> "); take --> node::dialogue_root; } dialogue_root { intent_labels = -[intent_transition]->.edge.intent; predicted_intent = bi_enc.infer( contexts = [question], candidates = intent_labels, context_type = "text", candidate_type = "text" )[0]["predicted"]["label"]; take -[intent_transition(intent==predicted_intent)]-> node::dialogue_state; } dialogue_state { std.out(here.response); }
} intent_labels = -[intent_transition]->.edge.intent collects the intent variables of all the outgoing intent_transition edges. This represents the list of candidate intent labels for this state. Try playing with different questions, such as $ jsctl
jaseci > jac run dialogue.jac
> hey yo, I heard tesla cars are great, how do i get one?
You can order a Tesla through our design studio.
