}

273.body:
Jac supports inheritance for nodes and edges. Node variables (defined with has) and node abilities (defined with can) are inherited and can be overwritten by children nodes. Here is an example: node vehicle { has plate_number; can get_plate_number { report here.plate_number; }
} node car:vehicle { has plate_number = "RAC001";
} node bus:vehicle { has plate_number = "SUB002";
} To learn more about inheritance in Jac, refer to the relevant sections of the Jaseci Bible.

275.body:
With the node abilities and node inheritance, we will now introduce state specific logic. Take a look at how the dialogue_root node definition has changed. node dialogue_state { can bi_enc.infer; can tfm_ner.extract_entity; can classify_intent { intent_labels = -[intent_transition]->.edge.intent; visitor.wlk_ctx["intent"] = bi_enc.infer( contexts = [visitor.question], candidates = intent_labels, context_type = "text", candidate_type = "text" )[0]["predicted"]["label"]; } can extract_entities { // Entity extraction logic will be added a bit later on. } can init_wlk_ctx { new_wlk_ctx = { "intent": null, "entities": {}, "prev_state": null, "next_state": null, "respond": false }; if ("entities" in visitor.wlk_ctx) { // Carry over extracted entities from previous interaction new_wlk_ctx["entities"] = visitor.wlk_ctx["entities"]; } visitor.wlk_ctx = new_wlk_ctx; } can nlu {} can process { if (visitor.wlk_ctx["prev_state"]): visitor.wlk_ctx["respond"] = true; else { visitor.wlk_ctx["next_state"] = net.root(); visitor.wlk_ctx["prev_state"] = here; } } can nlg {}
} node dialogue_root:dialogue_state { has name = "dialogue_root"; can nlu { ::classify_intent; } can process { visitor.wlk_ctx["next_state"] = (-[intent_transition(intent==visitor.wlk_ctx["intent"])]->)[0]; } can nlg { visitor.response = "Sorry I can't handle that just yet. Anything else I can help you with?"; }
} There are many interesting things going on in these ~30 lines of code so let's break it down! The dialogue_state node is the parent node and it is similar to a virtual class in OOP. It defines the variables and abilities of the nodes but the details of the abilities will be specified in the inheriting children nodes. In this case, dialogue_state has 4 node abilities: can nlu: NLU stands for Natural Language Understanding. This ability will analyze user's incoming requset and apply AI models. can process: This ability uses the NLU results and figure out the next dialogue state the walker should go to. can nlg: NLG stands for Natural Language Generation. This abilitiy will compose response to the user, often based on the results from nlu. can classify_intent: an ability to handle intent classification. This is the same intent classification logic that has been copied over from the walker. can extract_entities: a new ability with a new AI model -- entity extraction. We will cover that just in a little bit (read on!). Between these four node abilities, classify_intent and extract_entities have concrete logic defined while nlu and nlg are "virtual node abilities", which will be specified in each of the inheriting children. For example, dialogue_root inherit from dialogue_state and overwrites nlu and nlg: for nlu, it invokes intent classification because it needs to decide what's the intent of the user (test drive vs order a tesla). for nlg, it just has a general fall-back response in case the system can't handle user's ask. New Syntax : visitor is the walker that is "visiting" the node. And through visitor.*, the node abilities can access and update the context of the walker. In this case, the node abilities are updating the response variable in the walker's context so that the walker can return the response to its caller, as well as the wlk_ctx variable that will contain various walker context as the walker traverse the graph. the init_wlk_ctx ability initializes the wlk_ctx variable for each new question. In this new node architecture, each dialogue state will have its own node type, specifying their state-specific logic in nlu, nlg and process. Let's take a look! node how_to_order_state:dialogue_state { has name = "how_to_order"; can nlg { visitor.response = "You can order a Telsa through our design studio"; }
} node test_drive_state:dialogue_state { has name = "test_drive"; can nlu { if (!visitor.wlk_ctx["intent"]): ::classify_intent; ::extract_entities; } can process { // Check entity transition required_entities = -[entity_transition]->.edge[0].context["entities"]; if (vector.sort_by_key(visitor.wlk_ctx["entities"].d::keys) == vector.sort_by_key(required_entities)) { visitor.wlk_ctx["next_state"] = -[entity_transition]->[0]; visitor.wlk_ctx["prev_state"] = here; } elif (visitor.wlk_ctx["prev_state"] and !visitor.wlk_ctx["prev_state"].context["name"] in ["test_drive", "td_confirmation"]){ next_state = -[intent_transition(intent==visitor.wlk_ctx["intent"])]->; if (next_state.length > 0 and visitor.wlk_ctx["intent"] != "no") { visitor.wlk_ctx["next_state"] = next_state[0]; visitor.wlk_ctx["prev_state"] = here; } else { visitor.wlk_ctx["respond"] = true; } } else { visitor.wlk_ctx["respond"] = true; } } can nlg { if ("name" in visitor.wlk_ctx["entities"] and "address" not in visitor.wlk_ctx["entities"]): visitor.response = "What is your address?"; elif ("address" in visitor.wlk_ctx["entities"] and "name" not in visitor.wlk_ctx["entities"]): visitor.response = "What is your name?"; else: visitor.response = "To set you up with a test drive, we will need your name and address."; }
} node td_confirmation:dialogue_state { has name = "test_drive_confirmation"; can nlu { if (!visitor.wlk_ctx["intent"]): ::classify_intent; } can process { if (visitor.wlk_ctx["prev_state"]): visitor.wlk_ctx["respond"] = true; else { visitor.wlk_ctx["next_state"] = -[intent_transition(intent==visitor.wlk_ctx["intent"])]->[0]; visitor.wlk_ctx["prev_state"] = here; } } can nlg { visitor.response = "Can you confirm your name to be " + visitor.wlk_ctx["entities"]["name"][0] + " and your address as " + visitor.wlk_ctx["entities"]["address"][0] + "?"; }
} node td_confirmed:dialogue_state { has name = "test_drive_confirmed"; can nlg { visitor.response = "You are all set for a Tesla test drive!"; }
} node td_canceled:dialogue_state { has name = "test_drive_canceled"; can nlg { visitor.response = "No worries. We look forward to hearing from you in the future!"; }
} Each dialogue state now has its own node type, all inheriting from the same generic dialogue_state node type. We have 4 dialogue states here for the test drive capability: test_drive: This is the main state of the test drive intent. It is responsible for collecting the neccessary information from the user. test_drive_confirmation: Ths is the state for user to confirm the information they have provided are correct and is ready to actually schedule the test drive. test_drive_confirmed: This is the state after the user has confirmed. test_drive_canceled: User has decided, in the middle of the dialogue, to cancel their request to schedule a test drive. The process ability contains the logic that defines the conversational flow of the dialogue system. It uses the data in wlk_ctx and assign a next_state which will be used by the walker in a take statement, as you will see in a just a little bit. New Syntax : The code in test_drive_state's ability demonstrates jac support for list and dictionary. To access the list and dictionary-specific functions, first cast the variable with .l/.list for list and .d/.dict for dictionaries, then proceed with : to access the built-in functions for list and dictioinaries. For more on jac's built-in types, refer to the relevant sections of the Jaseci Bible. Specifically in this case, we are comparing the list of entities of the entity_transition edge with the list of entities that have been extracted by the walker and the AI model (stored in wlk_ctx["entities]). Since there can be multiple entities required and they can be extracted in arbitrary order, we are sorting and then comparing here. New Syntax : -[entity_transition]->.edge shows how to access the edge variable. Consider -[entity_transition]-> as a filter. It returns all valid nodes that are connected to the implicit here via an entity_transition. On its own, it will return all the qualified nodes. When followed by .edge, it will return the set of edges that are connected to the qualified nodes. You might notice that some states do not have a process ability. These are states that do not have any outgoing transitions, which we refer to as leaf nodes. If these nodes are reached, they indicate that a dialogue has been completed end to end. The next state for these node will be returning to the root node so that the next dialogue can start fresh. To facilitate this, we will add the following logic to the process ability of the parent dialogue_state node so that by default, any nodes inheriting it will follow this rule. node dialogue_state {
... can process { if (visitor.wlk_ctx["prev_state"]): visitor.wlk_ctx["respond"] = true; else { visitor.wlk_ctx["next_state"] = net.root(); visitor.wlk_ctx["prev_state"] = here; } }
...
} Note Pay attention to the 4 dialogue states here. This pattern of main -> confirmation -> confirmed -> canceled is a very common conversational state graph design pattern and can apply to many topics, e.g., make a restaurant reservation and opening a new bank account. Essentially, almost any action-oriented requests can leverage this conversational pattern. Keep this in mind!

276.body:
Previously, we have introduced intent classification and how it helps to build a dialogue system. We now introduce the second key AI models, that is specifically important for a multi-turn dialogue system, that is entity/slot extraction. Entity extraction is a NLP task that focuses on extracting words or phrases of interests, or entities, from a given piece of text. Entity extraction, sometimes also referred to as Named Entity Recognition (NER), is useful in many domains, including information retrieval and conversational AI. We are going to use a transformer-based entity extraction model for this exercise. Let's first take a look at how we are going to use an entity model in our program. Then we will work on training an entity model. First, we introduce a new type of transition: edge entity_transition { has entities;
} Recall the intent_transition that will trigger if the intent is the one that is being predicted. Similarly, the idea behind an entity_transition is that we will traverse this transition if all the specified entities have been fulfilled, i.e., they have been extracted from user's inputs. With the entity_transition, let's update our graph graph dialogue_system { has anchor dialogue_root; spawn { dialogue_root = spawn node::dialogue_root; test_drive_state = spawn node::test_drive_state; td_confirmation = spawn node::td_confirmation; td_confirmed = spawn node::td_confirmed; td_canceled = spawn node::td_canceled; how_to_order_state = spawn node::how_to_order_state; dialogue_root -[intent_transition(intent="test drive")]-> test_drive_state; test_drive_state -[intent_transition(intent="cancel")]-> td_canceled; test_drive_state -[entity_transition(entities=["name", "address"])]-> td_confirmation; test_drive_state -[intent_transition(intent="provide name or address")]-> test_drive_state; td_confirmation - [intent_transition(intent="yes")]-> td_confirmed; td_confirmation - [intent_transition(intent="no")]-> test_drive_state; td_confirmation - [intent_transition(intent="cancel")]-> td_canceled; dialogue_root -[intent_transition(intent="order a tesla")]-> how_to_order_state; }
} Your graph should look something like this! Multi-turn Dialogue Graph

278.body:
Let's now train an entity extraction model! We are using a transformer-based token classification model. First, we need to load the actions. The action set is called tfm_ner (tfm stands for transformer). jaseci > actions load module jaseci_kit.tfm_ner Warning If you installed jaseci_kit prior to September 5th, 2022, please upgrade via pip install --upgrade jaseci_kit. There has been an update to the module that you will need for remainder of this exercise. You can check your installed version via pip show jaseci_kit. You need to be on version 1.3.4.6 or higher. Similar to Bi-encoder, we have provided a jac program to train and inference with this model, as well as an example training dataset. Go into the code/ directory and copy tfm_ner.jac and ner_train.json to your working directory. We are training the model to detect two entities, name and address, for the test drive use case. Let's quickly go over the training data format. [ "sure my name is [tony stark](name) and i live at [10880 malibu point california](address)", "my name is [jason](name)"
] The training data is a json list of strings, each of which is a training example. [] indicate the entitiy text while the () following it defines the entity type. So in the example above, we have two entities, name:tony stark and address: 10880 malibu point california. To train the model, run jaseci > jac run tfm_ner.jac -walk train -ctx "{\"train_file\": \"ner_train.json\"}" After the model is finished training, you can play with the model using the infer walker jaseci > jac run ner.jac -walk infer For example, jaseci > jac run tfm_ner.jac -walk infer
Enter input text (Ctrl-C to exit)> my name is jason
[{"entity_text": "jason", "entity_value": "name", "conf_score": 0.5514775514602661, "start_pos": 11, "end_pos": 16}] The output of this model is a list of dictionaries, each of which is one detected entitiy. For each detected entity, entity_value is the type of entity, so in this case either name or address; and entity_text is the detected text from the input for this entity, so in this case the user's name or their address. Let's now update the node ability to use the entity model. node dialogue_state { ... can extract_entities { res = tfm_ner.extract_entity(visitor.question); for ent in res { ent_type = ent["entity_value"]; ent_text = ent["entity_text"]; if (!(ent_type in visitor.wlk_ctx["entities"])){ visitor.wlk_ctx["entities"][ent_type] = []; } visitor.wlk_ctx["entities"][ent_type].l::append(ent_text); } ...
} There is one last update we need to do before this is fully functional. Because we have more dialogue states and a more complex graph, we need to update our classifier to include the new intents. We have provided an example training dataset at code/clf_train_2.json. Re-train the bi-encoder model with this dataset. Note Refer to previous code snippets if you need a reminder on how to train the bi-encoder classifier model. Now try running the walker again with jac run dialogue.jac! Congratulations! You now have a fully functional multi-turn dialogue system that can handle test drive requests!

279.body:
So far, we have built two separate conversational AI systems, a FAQ system that automatically scales with the available question-answer pairs and a multi-turn action-oriented dialogue system that can handle complex requests. These two systems serve different use cases and can be combined to a single system to provide a flexible and robust conversational AI experience. In this section, we are going to unify these two systems into one coherent conversational AI system. While these two systems rely on different AI models, they share many of the same logic flow. They both follow the general steps of first analyizing user's question with NLU AI models, make decision on the next conversational state to be and then construct and return a response to the user. Leveraging this shared pattern, we will first unify the node architecture of the two systems with a single parent node type, cai_state (cai is short of conversational AI). node cai_state { has name; can init_wlk_ctx { new_wlk_ctx = { "intent": null, "entities": {}, "prev_state": null, "next_state": null, "respond": false }; if ("entities" in visitor.wlk_ctx) { // Carry over extracted entities from previous interaction new_wlk_ctx["entities"] = visitor.wlk_ctx["entities"]; } visitor.wlk_ctx = new_wlk_ctx; } can nlu {} can process { if (visitor.wlk_ctx["prev_state"]): visitor.wlk_ctx["respond"] = true; else { visitor.wlk_ctx["next_state"] = net.root(); visitor.wlk_ctx["prev_state"] = here; } } can nlg {}
} Note that the logic for init_wlk_ctx and the default process logic have been hoisted up into cai_state as they are shared by the dialogue system and FAQ system. You can remove these two abilities from dialogue_state node, as it will be inheriting them from cai_state now. We then update the defintion of dialogue_state in dialogue.jac to inherit from cai_state: node dialogue_state:cai_state{ // Rest of dialogue_state code remain the same
} Before we move on, we will take a quick detour to introduce multi-file jac program and how import works in jac.

281.body:
For faq_state, we need to now define the nlu and nlg node abilities for FAQ. So let's update the following in faq.jac First, faq_root node faq_root:cai_state { can use.qa_classify; can nlu { if (!visitor.wlk_ctx["prev_state"]) { answers = -->.answer; best_answer = use.qa_classify( text = visitor.question, classes = answers ); visitor.wlk_ctx["intent"] = best_answer["match"]; } } can process { if (visitor.wlk_ctx["prev_state"]): visitor.wlk_ctx["respond"] = true; else { for n in --> { if (n.context["answer"] == visitor.wlk_ctx["intent"]){ visitor.wlk_ctx["next_state"] = n; break; } } visitor.wlk_ctx["prev_state"] = here; } } can nlg { visitor.response = "I can answer a variety of FAQs related to Tesla. What can I help you with?"; }
} At this point, if you have been following this journey along, this code should be relatively easy to understand. Let's quickly break it down. For FAQ, the nlu logic uses the USE QA model to find the most relevant answer. Here we are re-using the intent field in the walker context to save the matched answer. You can also opt to create another field dedicated to FAQ NLU result. For the traversal logic, this is very similar to the previous FAQ logic, i.e. find the faq_state node connected to here that contains the most relevant answer. for n in --> iterates through all the nodes connected with an outgoing edge from the current node. You can use .context on any node variables to access its variables. And the logic for the faq_state that contains the answer is relatively simple; node faq_state:cai_state { has question; has answer; can nlg { visitor.response = here.answer; }
} With these new nodes created, let's update our graph definition. We have renamed our graph to be tesla_ai and the dialogue.jac file to tesla_ai.jac. graph tesla_ai { has anchor dialogue_root; spawn { dialogue_root = spawn node::dialogue_root; test_drive_state = spawn node::test_drive_state; td_confirmation = spawn node::td_confirmation; td_confirmed = spawn node::td_confirmed; td_canceled = spawn node::td_canceled; dialogue_root -[intent_transition(intent="test drive")]-> test_drive_state; test_drive_state -[intent_transition(intent="cancel")]-> td_canceled; test_drive_state -[entity_transition(entities=["name", "address"])]-> td_confirmation; test_drive_state -[intent_transition(intent="provide name or address")]-> test_drive_state; td_confirmation - [intent_transition(intent="yes")]-> td_confirmed; td_confirmation - [intent_transition(intent="no")]-> test_drive_state; td_confirmation - [intent_transition(intent="cancel")]-> td_canceled; faq_root = spawn graph::faq; dialogue_root -[intent_transition(intent="i have a question")]-> faq_root; }
} One thing worth pointing out here is that we are spawning a graph inside a graph spawn block. Our graph should now looks like this! Here comes the biggest benefit of our unified node architecture -- the exact same walker logic can be shared to traverse both systems. The only change we need to make is to change from dialogue_state to cai_state to apply the walker logic to a more generalized set of nodes. walker talk { ... root { take --> node::dialogue_root; } cai_state { if (!question) { question = std.input("Question (Ctrl-C to exit)> "); here::init_wlk_ctx; } ... }
} Update the graph name in the init walker as well. walker init { root { spawn here --> graph::tesla_ai; spawn here walker::talk; }
} To compile the program, jaseci > jac build tesla_ai.jac As mentioned before, if the compiliation succeedd, a tesla_ai.jir will be generated. Note Run into issues at this build step? First check if all the imports are set up correctly. Running a jir is just like running a jac file jaseci > jac run tesla_ai.jir One last step, since we introduce a new intent i have a questions, we need to update our classifier model again. This time, use the clf_train_3.json example training data. The model is trained? Great! Now run the jir and try questions like "I have some telsa related questions" then following with FAQ questioins! Congratulations! You have created a single conversational AI system that is capable of answering FAQs and perform complex multi-step actions.

285.body:
Just like any program, a set of automatic tests cases with robust coverage is essential to the success of the program through development to production. Jac has built-in tests support and here is how you create a test case in jac. import {*} with "tesla_ai.jac"; test "testing the Tesla conv AI system"
with graph::tesla_ai by walker::talk(question="Hey I would like to go on a test drive"){ res = std.get_report(); assert(res[-1] == "To set you up with a test drive, we will need your name and address.");
} Let's break this down. test "testing the tesla conv AI system" names the test. with graph::tesla_ai specify the graph to be used as the text fixture. by walker::talk specify the walker to test. It will be spawned on the anchor node of the graph. std.get_report() let you access the report content of the walker so that you can set up any assertion neccessary with assert. To run jac tests, save the test case(s) in a file (say tests.jac) and import the neccessary walkers and graphs. Then run jaseci > jac test tests.jac This will execute all the test cases in tests.jac squentially and report success or any assertion failures.

