# Use USE encoder for zero-shot intent classification
walker use_enc_example { can use.encode, use.cos_sim_score; has text = "What is the weather tomorrow?"; has candidates = [ "weather forecast", "ask for direction", "order food" ]; text_emb = use.encode(text)[0]; cand_embs = use.encode(candidates); # use.encode handles string/list max_score = 0; max_cand = 0; cand_idx = 0; for cand_emb in cand_embs { cos_score = use.cos_sim_score(cand_emb, text_emb); if (cos_score > max_score) { max_score = cos_score; max_cand = cand_idx; } cand_idx += 1; } predicted_cand = candidates[max_cand];
}

