# Use USE_QA model for zero-shot text classification
walker use_qa_example { can use.qa_similarity; has questions = "What is your age?"; has responses = ["I am 20 years old.", "good morning"]; has response_contexts = ["I will be 21 next year.", "great day."]; max_score = 0; max_cand = 0; cand_idx = 0; for response in responses { cos_score = use.qa_similarity(text1=questions,text2=response); std.out(cos_score); if (cos_score > max_score) { max_score = cos_score; max_cand = cand_idx; } cand_idx += 1; } predicted_cand = responses[max_cand];
}

