For this tutorial, we are going to train and infer the biencoder for intent classification its train on snips train datasets and infer on test dataset, which is categorizing an incoming text into a one of predefined intents. Creating Jac Program (train and infer bi_enc) Create a file by name bi_encoder.jac Create node model_dir and bi_encoder in bi_encoder.jac file node model_dir;
node bi_encoder {}; Initializing node bi_encoder and import train and infer ability inside node. # import train and infer ability
can bi_enc.train, bi_enc.infer; Initialize module train and infer inside bi_encoder node bi_enc.train take training argument and start traing bi_enc module can train_bi_enc with train_bi_enc entry{
# Code snippet for training the model
train_data = file.load_json(visitor.train_file); # Train the model report bi_enc.train( dataset=train_data, from_scratch=visitor.from_scratch, training_parameters={ "num_train_epochs": visitor.num_train_epochs.int } );
}
# prediction on test dataset
can infer with train_bi_enc exit{ # Use the model to perform inference # returns the list of context with the suitable candidates test_data = file.load_json(visitor.test_file); resp_data = bi_enc.infer( contexts=test_data["contexts"], candidates=test_data["candidates"], context_type=test_data["context_type"], candidate_type=test_data["candidate_type"] ); # the infer action returns all the candidate with the confidence scores # Iterate through the candidate labels and their predicted scores result = []; for pred in resp_data.list{ text = pred["context"]; max_score = 0; max_intent = ""; for j=0 to j<pred["candidate"].length by j+=1 { if (pred["score"][j] > max_score){ max_intent = pred["candidate"][j]; max_score = pred["score"][j]; } } result.list::append({ "context":text, "predicted intent":max_intent, "Conf_Score":max_score }); } report [result];
}
# predict intent on new text
can predict with predict entry{ # Use the model to perform inference
# returns the list of context with the suitable candidates
test_data = file.load_json(visitor.test_data_file);
resp_data = bi_enc.infer( contexts=test_data["contexts"], candidates=test_data["candidates"], context_type=test_data["context_type"], candidate_type=test_data["candidate_type"] );
# the infer action returns all the candidate with the confidence scores
# Iterate through the candidate labels and their predicted scores
pred = resp_data[0]
context = pred["contexts"]
max_score = 0;
max_intent = "";
for j=0 to j<pred["candidate"].length by j+=1 { if (pred["score"][j] > max_score){ max_intent = pred["candidate"][j]; max_score = pred["score"][j]; }
}
report [{ "context":text, "pred intent":max_intent, "Conf_Score":max_score }];
} Parameter details train: will be used to train the Bi-Encoder on custom data Input: dataset (Dict): dictionary of candidates and suportting contexts for each candidate from_scratch (bool): if set to true train the model from scratch otherwise trains incrementally training_parameters (Dict): dictionary of training parameters Returns: text when model training is completed infer: will be used to predits the most suitable candidate for a provided context, takes text or embedding Input: contexts (string or list of strings): context which needs to be classified candidates (string or list of strings): list of candidates for the context context_type (string): can be text or embedding type candidate_type (string): can be text or embedding type Return: a dictionary of similarity score for each candidate and context Adding edge name of bi_model in bi_encoder.jac file for connecting nodes inside graph. # adding edge
edge bi_model { has model_type;
} Adding graph name of bi_encoder_graph for initializing node . graph bi_encoder_graph { has anchor bi_model_dir; spawn { bi_model_dir = spawn node::model_dir; bi_encoder_node = spawn node::bi_encoder; bi_model_dir -[bi_model(model_type="bi_encoder")]-> bi_encoder_node; }
} Initializing walker init for calling graph walker init { root { spawn here --> graph::bi_encoder_graph; }
} Creating walker name of train_bi_enc for getting parameter from context or default and calling ability train and infer bi_encoder. # Declaring the walker: walker train_bi_enc{ # the parameters required for training has train_file = "train_bi.json"; has from_scratch = true; has num_train_epochs = 20; has test_file = "test_bi.json"; root { take --> node::model_dir; } model_dir { take -->; }
} Default parameter for train and test biencoder train_file : local path of train_bi.json file from_scratch : true num_train_epochs : 20 test_file : local path of test_bi.json file Declaring walker for predicting intents on new text walker predict{ has test_data_file = "test_dataset.json"; root { take --> node::model_dir; } model_dir { take -->; }
} Final bi_encoder.jac program we are conmbining all steps from 2 to 8 inside bi_encoder.jac node model_dir;
node bi_encoder{ # import train and infer ability can bi_enc.train, bi_enc.infer; can train_bi_enc with train_bi_enc entry{ #Code snippet for training the model train_data = file.load_json(visitor.train_file); # Train the model report bi_enc.train( dataset=train_data, from_scratch=visitor.from_scratch, training_parameters={ "num_train_epochs": visitor.num_train_epochs.int } ); } can infer with train_bi_enc exit{ # Use the model to perform inference # returns the list of context with the suitable candidates test_data = file.load_json(visitor.test_file); resp_data = bi_enc.infer( contexts=test_data["contexts"], candidates=test_data["candidates"], context_type=test_data["context_type"], candidate_type=test_data["candidate_type"] ); # the infer action returns all the candidate with the confidence scores # Iterate through the candidate labels and their predicted scores result = []; for pred in resp_data.list{ text = pred["context"]; max_score = 0; max_intent = ""; for j=0 to j<pred["candidate"].length by j+=1 { if (pred["score"][j] > max_score){ max_intent = pred["candidate"][j]; max_score = pred["score"][j]; } } result.list::append({ "context":text, "predicted intent":max_intent, "Conf_Score":max_score }); } report [result]; } # predict intent on new text can predict with predict entry{ # Use the model to perform inference test_data = file.load_json(visitor.test_data_file); resp_data = bi_enc.infer( contexts=test_data["contexts"], candidates=test_data["candidates"], context_type=test_data["context_type"], candidate_type=test_data["candidate_type"] ); # the infer action returns all the candidate with the confidence scores # Iterate through the candidate labels and their predicted scores pred = resp_data[0]; max_score = 0; max_intent = ""; for j=0 to j<pred["candidate"].length by j+=1 { if (pred["score"][j] > max_score){ max_intent = pred["candidate"][j]; max_score = pred["score"][j]; } } report [{ "context": pred["context"], "pred intent": max_intent, "Conf_Score": max_score }]; }
} # adding edge
edge bi_model { has model_type;
} graph bi_encoder_graph { has anchor bi_model_dir; spawn { bi_model_dir = spawn node::model_dir; bi_encoder_node = spawn node::bi_encoder; bi_model_dir -[bi_model(model_type="bi_encoder")]-> bi_encoder_node; }
} walker init { root { spawn here --> graph::bi_encoder_graph; }
} # Declaring the walker: walker train_bi_enc{ # the parameters required for training has train_file = "train_bi.json"; has from_scratch = true; has num_train_epochs = 20; has test_file = "test_bi.json"; root { take --> node::model_dir; } model_dir { take -->; }
} # declaring walker for predicting intents on new text
walker predict{ # passing input data for prediction has test_data_file = "test_dataset.json"; root { take --> node::model_dir; } model_dir { take -->; }
} Steps for running bi_encoder.jac programm Build bi_encoder.jac by run cmd jac build bi_encoder.jac Activate sentinal by run cmd sentinel set -snt active:sentinel -mode ir bi_encoder.jir Note : If getting error ValueError: badly formed hexadecimal UUID string execute only once sentinel register -set_active true -mode ir bi_encoder.jir Calling walker train_bi_enc with default parameter for training bi_enc module by cmd walker run train_bi_enc After 3rd step running logging will shown on console training logs jaseci > walker run train_bi_enc
