For this tutorial we are going to classify entity text with flair ner(ent_ext) module on tars-ner pretrained model. Creating jac program for zero-shot(ent_ext) Create a file by name zero_shot_ner.jac Create node model_dir and flair_ner in zero_shot_ner.jac file node model_dir;
node flair_ner {}; Initializing node flair_ner and adding abilty set_config and entity_detection node flair_ner{ # set model configuration and infer entity ent_ext.set_config, can ent_ext.entity_detection; } Initializing module for set_config inside node flair_ner set_config will get parameter from context and load model in module. its take two argument model_name(str) an model_type(str). can set_config with infer_zero_shot entry{ report ent_ext.set_config( ner_model = visitor.model_name, model_type = visitor.model_type );
} Initializing module infer_zero_shot for zero_shot tokenclassification inside flair_ner node infer_zero_shot module take two arguments text and labels list for infer entity. can infer_zero_shot with infer_zero_shot entry{ text = visitor.text; labels = visitor.labels.list; result = ent_ext.entity_detection( text=text, ner_labels= labels ); fn = "result.json"; result = {"text":text,"entities":result["entities"]}; file.dump_json(fn, result);
} Adding edge name of ner_model in zero_shot_ner.jac file for connecting nodes inside graph. # adding edge
edge ner_model { has model_type;
} Adding graph name of ner_val_graph for initializing node . graph ner_eval_graph { has anchor ner_model_dir; spawn { ner_model_dir = spawn node::model_dir; flair_ner_node = spawn node::flair_ner; ner_model_dir -[ner_model(model_type="flair_ner")]-> flair_ner_node; }
} Initializing walker init for calling graph walker init { root { spawn here --> graph::ner_val_graph; }
} Creating walker name of infer_zero_shot for getting parameter from context and calling ability set_config and infer_zero_shot entity detection. # creating walker for entity predictions
walker infer_zero_shot{ has model_name; has model_type; has text; has labels; root { take --> node::model_dir; } model_dir { take -->; }
} It take arguments from context and call ability to set model configuration set_config and infer_zero_shot for detecting entity from text and store result in result.json file Final jac program zero_shot_ner.jac node model_dir;
node flair_ner { # load the model actions here can ent_ext.entity_detection, ent_ext.set_config; can set_config with infer_zero_shot entry{ report ent_ext.set_config( ner_model = visitor.model_name, model_type = visitor.model_type ); } can infer_zero_shot with infer_zero_shot entry{ text = visitor.text; labels = visitor.labels.list; result = ent_ext.entity_detection( text=text, ner_labels= labels ); fn = "result.json"; result = {"text":text,"entities":result["entities"]}; file.dump_json(fn, result); }
} edge ner_model { has model_type;
} graph ner_eval_graph { has anchor ner_model_dir; spawn { ner_model_dir = spawn node::model_dir; flair_ner_node = spawn node::flair_ner; ner_model_dir -[ner_model(model_type="flair_ner")]-> flair_ner_node; }
} walker init { root { spawn here --> graph::ner_eval_graph; }
} # creating walker for entity predictions
walker infer_zero_shot{ has model_name; has model_type; has text; has labels; root { take --> node::model_dir; } model_dir { take -->; }
} Steps for calling jac program use case 1 and infer_zero_shot entity from new text. Build zero_shot_ner.jac by run cmd jac build zero_shot_ner.jac Activate sentinal by run cmd: sentinel set -snt active:sentinel -mode ir zero_shot_ner.jir Note : If getting error ValueError: badly formed hexadecimal UUID string execute only once sentinel register -set_active true -mode ir zero_shot_ner.jir Module entity_detection: detects all availabe entities from the provided context

