For this tutorial we are going to train the model on train dataset and validate the model on validation dataset and final test model on the test dataset. Creating Jac Program Create a file by name flair_ner.jac Create node model_dir and flair_ner in flair_ner.jac file node model_dir;
node flair_ner {}; Initializing node flair_ner and adding abilty set_config and entity_detection node flair_ner{ # set ability model configuration and train model ent_ext.set_config, can ent_ext.train, ent_ext.entity_detection; } Initializing module for set_config inside node flair_ner can set_config with infer_zero_shot entry{ report ent_ext.set_config( ner_model = visitor.model_name, model_type = visitor.model_type );
} set_config will take two argument model_name(str) and model_type(str). and load model for training and validation. Initializing module for train and infer inside node flair_ner can train with train_and_val_flair entry{ # train the model with a given dataset train_data = file.load_json(visitor.train_file); val_data = file.load_json(visitor.val_file); test_data = file.load_json(visitor.test_file); # training model ent_ext.train( train_data = train_data, val_data = val_data, test_data = test_data, train_params = { "num_epoch": visitor.num_train_epochs.int, "batch_size": visitor.batch_size.int, "LR": visitor.learning_rate.float });
} can infer with predict_flair entry{ report ent_ext.entity_detection( text = visitor.text, ner_labels = visitor.ner_labels.list );
} train will take 4 parameter describing in upcoming steps parameter_description Adding edge name of ner_model in flair_ner.jac file for connecting nodes inside graph. # adding edge
edge ner_model { has model_type;
} Adding graph name of ner_val_graph for initializing node . graph ner_eval_graph { has anchor ner_model_dir; spawn { ner_model_dir = spawn node::model_dir; flair_ner_node = spawn node::flair_ner; ner_model_dir -[ner_model(model_type="flair_ner")]-> flair_ner_node; }
} Initializing walker init for calling graph walker init { root { spawn here --> graph::ner_val_graph; }
} Creating walker name of train_and_val_flair for getting parameter from context and calling ability set_config and train and start training model on new dataset, validate and test ## creating walker walker train_and_val_flair { # Take in a training and eval dataset has train_file; has val_file; has test_file; has model_name="prajjwal1/bert-tiny"; has model_type="trfmodel"; has num_train_epochs=3; has batch_size=8; has learning_rate=0.02; # Train all NER models on the train set # and validate them on the val set # report accuracy performance on flair NER models root { take --> node::model_dir; } model_dir { take -->; }
} Here we are initialize some default argument and also we are providing all argument from context. it take arguments from context and call ability to set model configuration set_config and train is for training, val and test model on new datasets. Creating walker for predicting entities from trained flair model. # infer
walker predict_flair{ has text; #declare default labels has ner_labels = ["PER","ORG", "LOC", "MISC"]; root { take --> node::model_dir; } model_dir { take -->; } } Final Jac Program flair_ner.jac node model_dir;
node flair_ner { # load the model actions here can ent_ext.set_config, ent_ext.train, ent_ext.entity_detection; can set_config with train_and_val_flair entry{ ent_ext.set_config( ner_model = visitor.model_name, model_type = visitor.model_type ); } can train with train_and_val_flair entry{ # train the model with a given dataset train_data = file.load_json(visitor.train_file); val_data = file.load_json(visitor.val_file); test_data = file.load_json(visitor.test_file); # training model ent_ext.train( train_data = train_data, val_data = val_data, test_data = test_data, train_params = { "num_epoch": visitor.num_train_epochs.int, "batch_size": visitor.batch_size.int, "LR": visitor.learning_rate.float }); } can infer with predict_flair entry{ report ent_ext.entity_detection( text = visitor.text, ner_labels = visitor.ner_labels.list ); }
} edge ner_model { has model_type;
} graph ner_eval_graph { has anchor ner_model_dir; spawn { ner_model_dir = spawn node::model_dir; flair_ner_node = spawn node::flair_ner; ner_model_dir -[ner_model(model_type="flair_ner")]-> flair_ner_node; }
} walker init { root { spawn here --> graph::ner_eval_graph; }
} ## creating walker for:
# Train all NER models on the train set
# and validate them on the val set
# and test on test set
# report accuracy performance on flair NER models walker train_and_val_flair { # Take in a training and eval dataset has train_file; has val_file; has test_file; has model_name="prajjwal1/bert-tiny"; has model_type="trfmodel"; has num_train_epochs=3; has batch_size=8; has learning_rate=0.02; root { take --> node::model_dir; } model_dir { take -->; }
} # infer
walker predict_flair{ has text; #declare default labels has ner_labels = ["PER","ORG", "LOC", "MISC"]; root { take --> node::model_dir; } model_dir { take -->; } } Steps for calling jac program(flair_ner.jac) Build flair_ner.jac by run cmd : jac build flair_ner.jac Activate sentinal by run cmd: sentinel set -snt active:sentinel -mode ir flair_ner.jir Note : If getting error ValueError: badly formed hexadecimal UUID string execute only once sentinel register -set_active true -mode ir flair_ner.jir Create train and validation context: train model on train dataset file and validate and test on validate and test dataset file.

