For this tutorial we are going to train the model on train dataset and validate the model on validation dataset and finaly we test model on the test dataset. 1. Creating Jac Program Create a file (main.jac) Create node model_dir and tfm_ner in main.jac node model_dir;
node tfm_ner {} Initializing node tfm_ner and adding abilty:- train, infer Here we are importing ability to train and infer model. node tfm_ner { # train, infer can tfm_ner.train, tfm_ner.extract_entity, tfm_ner.load_model, tfm_ner.save_model, tfm_ner.get_train_config, tfm_ner.set_train_config;
} Initializing module for train and validation inside node tfm_ner In this step we are initializing training and validation of tfm_ner model. It will take 5 parameter train, test, val (file contain list of dict) and mode and epochs # train and validation model can train_and_val with train_and_val_tfm entry { train_data = file.load_json(visitor.train_file); val_data = file.load_json(visitor.val_file); test_data = file.load_json(visitor.test_file); std.out("corpus : ",train_data.length," train + ",val_data.length," val +",test_data.length," test sentences"); tfm_ner.train( mode = visitor.mode, epochs = visitor.num_train_epochs.int, train_data = train_data, dev_data = val_data, test_data = test_data ); std.out("training and validation done "); } Adding module for infer entity inside node tfm_ner Infer module will take text input and return entities list. # infer entity from text
can infer with predict_entity_from_tfm entry { report tfm_ner.extract_entity( text = visitor.text );
} Adding edge name of ner_model in main.jac file for connecting nodes inside graph. # adding edge
edge ner_model { has model_type;
} Adding graph name of ner_val_graph for initializing node . # Adding Graph
graph ner_val_graph { has anchor ner_model_dir; spawn { ner_model_dir = spawn node::model_dir; tfm_ner_node = spawn node::tfm_ner; ner_model_dir -[ner_model(model_type="tfm_ner")]-> tfm_ner_node; }
} Initializing walker init for calling graph walker init { root { spawn here --> graph::ner_val_graph; }
} Creating walker name of train_and_val_tfm for getting parameter from context and calling ability training and validation model. # creating walker walker train_and_val_tfm { has train_file; has val_file; has test_file; has num_train_epochs; has mode; # Train NER models on the train set # and validate them on the val set (Optional) # and test them on the test set (Optional) # report accuracy performance of NER model on inside dir creating on place of current path `main.jac` file "train/logs/" root { take --> node::model_dir; } model_dir { take -->; }
} Creating a walker name of predict_entity_from_tfm for getting new text as input from context and infer entities. walker predict_entity_from_tfm{ has text; root { take --> node::model_dir; } model_dir { take -->; }
} Final jac programm (main.jac) node model_dir;
node tfm_ner { # train,infer can tfm_ner.extract_entity, tfm_ner.train; # extracting entities can infer with predict_entity_from_tfm entry { report tfm_ner.extract_entity( text = visitor.text ); } ## train and validate can train_and_val with train_and_val_tfm entry { train_data = file.load_json(visitor.train_file); val_data = file.load_json(visitor.val_file); test_data = file.load_json(visitor.test_file); std.out("corpus : ",train_data.length," train + ",val_data.length," dev +",test_data.length," test sentences"); tfm_ner.train( mode = visitor.mode, epochs = visitor.num_train_epochs.int, train_data = train_data, dev_data = val_data, test_data = test_data ); std.out("training and validation done "); }
} edge ner_model { has model_type;
} graph ner_val_graph { has anchor ner_model_dir; spawn { ner_model_dir = spawn node::model_dir; tfm_ner_node = spawn node::tfm_ner; ner_model_dir -[ner_model(model_type="tfm_ner")]-> tfm_ner_node; }
} walker init { root { spawn here --> graph::ner_val_graph; }
} ## creating walker walker train_and_val_tfm { has train_file; has val_file; has test_file; has num_train_epochs; has mode; # Train all NER models on the train set # and validate them on the val set # report accuracy performance across all NER models root { take --> node::model_dir; } model_dir { take -->; }
} walker predict_entity_from_tfm{ has text; root { take --> node::model_dir; } model_dir { take -->; }
} 2. Steps for running main.jac file and train and validate tfm_ner model Build main.jac by run: jac build main.jac Run the following command to Activate sentinal: sentinel set -snt active:sentinel -mode ir main.jir Create Training Input mode: (String): mode for training the model, available options are : * default: train the model from scratch. * incremental: providing more training data for current set of entities. * append: changing the number of entities (model is restarted and trained with all of traindata). epochs : (int): Number of epoch you want model to train. train_file: list[dict] train data file name. val_file: list[dict] validation data file name. test_file: list[dict] test data file name. Run the following command to execute walker train_and_val_tfm walker run train_and_val_tfm -ctx "{\"train_file\":\"dataset/train.json\",\"val_file\":\"dataset/dev.json\",\"test_file\":\"dataset/test.json\",\"num_train_epochs\":\"50\",\"mode\":\"default\"}" You'll find the following logs in train folder. 2022-06-06 11:23:46.832007 Training epoch: 1/50
