Actions allow us to run arbitrary javascript functions and built-in functions provided by the ui kit in response to certain events. You can perform multiple actions, one after the other, or compose actions to perform an action after another completes, or fails. In the example above we created an alert action in response to an onClick event. Let's take a closer look at what we did. To create an action we need to create an object with the fn property and the args property. fn - the name of the function we want to call args - the values we pass to the function as arguments Here what our action looked like. "onClick": [ { "fn": "alert", "args": ["Jaseci"] }
] What if we wanted to update a property instead? We can changing our action function to update along provide its two args: the property we want to update and the value of the property. Here what our action looks like now. "onClick": [ { "fn": "update", "args": ["nav.label", "Jaseci 2.0"] }
] Assuming this onClick event is still attached to our nav link component, whenever we click on this link the label of the navbar will change from Jaseci to Jaseci 2.0. Action conditions Consider the following code. "onClick": [ { "fn": "update", "args": ["nav.label", "Jaseci 2.0"], "cond": ['var(nav.label)::#neq::Jaseci 2.0'], }
] What have you noticed? It works the same as before, however, there's now a cond property, this property allow us to prevent the execution of some actions unless a certain condition is satisfied. Each condition is a string. In this example, if we click update and the label is not already Jaseci 2.0 the action will run, if is Jaseci 2.0, it remain the same. We can provide multiple conditions to an action and the action will only run if all conditions are satisfied. Chaining Actions We can run until another is executed. We can do so by providing an action as the value to the onCompleted property of another action. Here's an example using the code above: "onClick": [ { "fn": "update", "args": ["nav.label", "Jaseci 2.0"], "cond": ['var(nav.label)::#neq::Jaseci 2.0'], "onCompleted": { "fn": "alert", "args": ["Navbar title updated."] } }
] Also consider the following code. "onClick": [ { "fn": "update", "args": ["nav.label", "Jaseci 2.0"], "cond": ['var(nav.label)::#neq::Jaseci 2.0'] }, { "fn": "alert", "args": ["Navbar title updated."] }
] In the first code above, we ask for an alert dialog to display after the update action is finished. But what about the second code, doesn't it work the same? In this case, yes, but also no. Taking a closer lock at the update action of the first code, it has a cond, this condition will also prevent the onCompleted action from running if the update function did not run. The second code will give us an alert dialog even if the update function did not run.

